import React, { Component } from 'react';
import TextField from '@mui/material/TextField';





const SignIn = () => {
   
    return (
      <div>
      <TextField
        
        sx={{
          width: 300,
          margin: "50px",
          '& .MuiFilledInput-root': {
            "& input > .MuiFilledInput-input": {
              borderColor: 'red',
            }
          },
        }}
        id="filled-basic" 
        label="Filled" 
        variant="filled" 
        // color="secondary"
        
      />
      </div>
    )
  
}

export default SignIn;
